import React from 'react';
import { Link } from 'react-router-dom';



const Header = () => {
  return (

<nav class="bg-white bg-black border-gray-200 px-2 sm:px-4 py-2.5 rounded dark:bg-gray-900">
  <div class="container flex flex-wrap items-center justify-between mx-auto">
    <a href="https://flowbite.com/" class="flex items-center">
    <Link to="/Home" ><span className='header_optionLionThree'>Home</span></Link>
    </a>
    <a href="https://flowbite.com/" class="flex items-center">
    <Link to="/Projects" ><span className='header_optionLionThree'>Projects </span></Link>
    </a>
    <a href="https://flowbite.com/" class="flex items-center">
    <Link to="/Experience" ><span className='header_optionLionThree'>Experience </span></Link>
    </a>

  </div>
</nav>

  );
};

export default Header;
